import React from "react";
import { SignInModal } from "../../components/ui/modals/AccountModals";
import ModalEffect from "../../components/ui/modals/ModalEffect";

const SignInPage = () => {
  return (
    <ModalEffect>
      <SignInModal>
        <p>로그인</p>
      </SignInModal>
    </ModalEffect>
  );
};

export default SignInPage;
